string = ''

_dict1 = {}
for char in string:							# O(len(string) * len(_dict1.keys()) * len(string)) == O(n^2 * m) where n is string.size() and m is _dict1.keys().size() 
	if (char not in _dict1.keys()):
		_dict1[char] = string.count(char)

"""
We prefer the following, faster implementation instead:
"""

_dict2 = {}
for char in string:							# O(len(string) * len(_dict2.keys())) == O(n * m) where n is string.size() and m is _dict2.keys().size()
	if (char not in _dict2.keys()):
		_dict2[char] = 1
	else:
		_dict2[char] += 1

print(_dict1 == _dict2)